// src/baseEmail.ts
var EMAIL_FROM = "Trampar de Casa <comece@trampardecasa.com.br>";

// src/sendEmails.ts
var sendEmails = async (buffers, channel, resendCli) => {
  const promises = buffers.map(async (message) => {
    const content = JSON.parse(
      message.content.toString()
    );
    const [email, { html, subject }] = Object.entries(content)[0];
    try {
      await resendCli.emails.send({
        from: EMAIL_FROM,
        to: email,
        html,
        subject
      });
      channel.ack(message);
    } catch (e) {
      console.error(e);
      channel.nack(message, false, true);
    }
  });
  await Promise.all(promises);
};

// src/emailSender.ts
var emailSender = async () => {
  console.time("emailSender");
  const resend = new import_resend2.Resend(CONFIG.RESEND_KEY);
  const channelToConsume = await createRabbitMqChannel();
  let count = 0, emailChunk = [], msg;
  do {
    msg = await channelToConsume.get("email-sender" /* EmailSender */);
    count++;
    if (!msg)
      break;
    if (count % 25 === 0) {
      console.time(`${count} emails sent!`);
      await sendEmails(emailChunk, channelToConsume, resend);
      console.timeEnd(`${count} emails sent!`);
      emailChunk = [];
    }
    emailChunk.push(msg);
  } while (msg);
  if (emailChunk.length) {
    await sendEmails(emailChunk, channelToConsume, resend);
    console.log(`sent [${count}] emails!`);
    emailChunk = [];
  }
  console.timeEnd("emailSender");
};

// src/index.ts
emailSender().catch((e) => {
  throw e;
});
